import logo from './WhatsApp Image 2021-06-06 at 12.22.18 AM.jpeg';


function Brandname() {
    return (
        <div className="row">
        <div className="logo">
          <img src={logo} width="500" height="50" />
        </div>
      </div>
    );
}

export default Brandname;
